import React from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  MiniMap,
  Background,
  Controls,
  Connection,
  Edge,
  Node,
  applyEdgeChanges,
  applyNodeChanges,
} from 'reactflow';
import 'reactflow/dist/style.css';
import { zinc } from 'tailwindcss/colors'

const OldFluxograma: React.FC = () => {

    return (
        <div className='w-screen h-screen'>
            <ReactFlow>
                <Background 
                    gap={12}
                    size={12}
                    color={zinc[200]}
                />
                <Controls />
            </ReactFlow>
        </div>
    )
};

export default OldFluxograma;
